    const selectedDate = watch('fecha');
    const apellidoPaterno = watch('apellidoPaterno');

    const handleSubmit = (event) => {
        event.preventDefault();
        const formData = {
            cfg_codigo: selectedTienda,
            tpc_codigo: selectedServicio,
            hor_fecha: selectedDate,
            htr_hora: selectedHora,
            tpo_codigo: selectedDocumento,
            int_apaterno: apellidoPaterno,
            int_amaterno: apellidoMaterno,
            int_pnombre: primerNombre,
            int_snombre: segundoNombre,
            int_telefono: telefono,
            int_email: correo,
            int_domicilio: domicilio,
            int_nrodocidentidad: numeroDocumento,
