        //     headers: {
        //         Authorization: `Bearer ${process.env.REACT_APP_BEARER_TOKEN}`
        //     }
        // })
        // .then(response => {
        //     alert(response.data.message); // Muestra el mensaje de éxito
        // })
        // .catch(error => {
        //     console.error('Hubo un problema al registrar la reserva.', error);
        //     alert('Hubo un problema al registrar la reserva.'); // Muestra un mensaje de error
        // });
    };

    return (
        <form onSubmit={handleSubmit}>
            <TextInput
                id="fecha"
                label="Fecha"
                type="date"
                {...register('fecha')}
            />
            <TextInput id="apellidoPaterno" label="Apellido Paterno" {...register('apellidoPaterno')} />
            <button type="submit">Registrar Cita</button>
        </form>
    );
}

export default FormularioPages;
